package model;public class Cliente {	private String nome;		private String login;	private String senha;	private String email;	private String fone;		public Cliente(String nome, String login, String senha, String email, String fone){		this.nome = nome;		this.login = login;		this.senha = senha;		this.email = email;		this.fone = fone;	}	public String getNome(){		return this.nome;	}	public String setNome(String nome){		return this.nome = nome;	}	public String getLogin(){		return this.login;	}	public void setLogin(){		return this.login = login;	}	public  String getSenha(){		return this.senha;	}	public void setSenha(String senha){		return this.senha = senha;	}	public String getEmail(){		return this.email;	}	public void setEmail(String email){		return this.email = email;	}	public String getFone(){		return this.fone;	}	public void setFone(String fone){		return this.fone = fone;	}}